import React, { useEffect, useState } from "react";
import './../App.css';



const InfoPanel = () => {
    const data = "2020-12-01";
    return(
        <div class="info-panel">
            <p>Wybrana data: {data}</p>
            <InfoEvent />
        </div>
    )
}

const InfoEvent = ({title}) => {
    return (
        <div class="info-event">
            <p>{title}</p>
        </div>
    )
}

export default InfoPanel;
